// src/pages/AdminDashboard/AdminDashboard.jsx
import React, { useState } from 'react';
import { useData } from '../../contexts/DataContext';
import './AdminDashboard.css';

const AdminDashboard = () => {
    const { services, products, pets, addService, addProduct } = useData();
    const [tab, setTab] = useState('servicios');

    // Estados de los formularios
    const [serviceForm, setServiceForm] = useState({ title: '', description: '', price: '', duration: '', category: 'Estética' });
    const [productForm, setProductForm] = useState({ name: '', price: '', stock: '', category: 'Alimentos' });

    const handleServiceSave = (e) => {
        e.preventDefault();
        addService(serviceForm);
        setServiceForm({ title: '', description: '', price: '', duration: '', category: 'Estética' });
        alert("Servicio dado de alta correctamente.");
    };

    const handleProductSave = (e) => {
        e.preventDefault();
        addProduct(productForm);
        setProductForm({ name: '', price: '', stock: '', category: 'Alimentos' });
        alert("Producto agregado al inventario.");
    };

    return (
        <div className="admin-container">
            <aside className="admin-sidebar">
                <h3>Panel Maestro</h3>
                <button onClick={() => setTab('servicios')} className={tab === 'servicios' ? 'active' : ''}>Servicios</button>
                <button onClick={() => setTab('productos')} className={tab === 'productos' ? 'active' : ''}>Productos</button>
                <button onClick={() => setTab('pacientes')} className={tab === 'pacientes' ? 'active' : ''}>Pacientes</button>
            </aside>

            <main className="admin-content">
                {tab === 'servicios' && (
                    <section>
                        <h2>Alta de Servicios</h2>
                        <form onSubmit={handleServiceSave} className="admin-form">
                            <input type="text" placeholder="Título del servicio" value={serviceForm.title} onChange={e => setServiceForm({...serviceForm, title: e.target.value})} required />
                            <textarea placeholder="Descripción" value={serviceForm.description} onChange={e => setServiceForm({...serviceForm, description: e.target.value})} required />
                            <div className="row">
                                <input type="number" placeholder="Precio ($)" value={serviceForm.price} onChange={e => setServiceForm({...serviceForm, price: e.target.value})} required />
                                <input type="text" placeholder="Duración (Ej: 1h)" value={serviceForm.duration} onChange={e => setServiceForm({...serviceForm, duration: e.target.value})} required />
                            </div>
                            <button type="submit" className="btn-save">Guardar Servicio</button>
                        </form>

                        <div className="data-list">
                            <h4>Servicios Vigentes</h4>
                            {services.map(s => <div key={s.id} className="data-item">{s.title} - ${s.price}</div>)}
                        </div>
                    </section>
                )}

                {tab === 'productos' && (
                    <section>
                        <h2>Inventario de Tienda</h2>
                        <form onSubmit={handleProductSave} className="admin-form">
                            <input type="text" placeholder="Nombre del Producto" value={productForm.name} onChange={e => setProductForm({...productForm, name: e.target.value})} required />
                            <div className="row">
                                <input type="number" placeholder="Precio ($)" value={productForm.price} onChange={e => setProductForm({...productForm, price: e.target.value})} required />
                                <input type="number" placeholder="Stock Inicial" value={productForm.stock} onChange={e => setProductForm({...productForm, stock: e.target.value})} required />
                            </div>
                            <button type="submit" className="btn-save">Agregar a Tienda</button>
                        </form>
                    </section>
                )}

                {tab === 'pacientes' && (
                    <section>
                        <h2>Expedientes Médicos / Mascotas</h2>
                        <div className="patient-grid">
                            {pets.length > 0 ? pets.map(p => (
                                <div key={p.id} className="patient-card">
                                    <h4>{p.petName} ({p.species})</h4>
                                    <p>Raza: {p.breed}</p>
                                    <p>Peso: {p.weight}kg</p>
                                    <p>Notas: {p.notes}</p>
                                </div>
                            )) : <p>No hay mascotas registradas aún.</p>}
                        </div>
                    </section>
                )}
            </main>
        </div>
    );
};

export default AdminDashboard;
